#include "common.h"

class Solution {
  public:
    string makeFancyString(string s) {
        // Regex is way too slow
        // regex reg("([a-z])\\1{2,}", regex_constants::ECMAScript & regex_constants::optimize);
        // cout << regex_search(s, reg) << endl;
        // return regex_replace(s, reg, "$01$01");

        // Not very performant
        // size_t sLength = s.length();
        // size_t repeats = 1;
        // for (int i = 1; i < sLength; i++) {
        //     if (s[i] != s[i - 1]) {
        //         if (repeats > 2) {
        //             int start = i - repeats + 2;
        //             s.erase(start, repeats - 2);
        //             sLength = s.length();
        //             i = start;
        //         }
        //         repeats = 1;
        //     } else {
        //         repeats++;
        //     }
        // }
        // if (repeats > 2) {
        //     int start = sLength - repeats + 2;
        //     s.erase(start, repeats - 2);
        // }
        // return s;

        // Slightly better performance, still far from the fastest
        size_t sLength = s.length();
        if (sLength < 3) {
            return s;
        }

        size_t repeats = 1;
        for (int i = sLength - 1; i >= 0; i--) {
            if (s[i] != s[i + 1]) {
                if (repeats > 2) {
                    s.erase(i + 3, repeats - 2);
                }
                repeats = 1;
            } else {
                repeats++;
            }
        }
        if (repeats > 2) {
            s.erase(2, repeats - 2);
        }
        return s;
    }
};

